import React, { useState, useEffect } from 'react'
import {Link} from "react-router-dom"
import CourseAndPlayerScorecard from '../../components/CourseAndPlayerScorecard'
import PlayerScorecardsService from '../../services/playerScorecardsService'

const DeletePlayerScorecard = (props) => {
    const [playerScorecard, setPlayerScorecard] = useState([])

    const getPlayerScorecard = id => {
        PlayerScorecardsService.get(id)
            .then(response => {
                setPlayerScorecard(response.data);
                console.log(response.data);
            })
            .catch(e => {
                console.log(e)
            });
    };

    useEffect(() => {
        getPlayerScorecard(props.match.params.playerScorecardId);
    }, [props.match.params.playerScorecardId]);

    const deleteScorecard = (id) => {
        PlayerScorecardsService.deletePlayerScorecard(props.match.params.playerScorecardId)
            .then(response => {
                console.log(response.data)
            })
            .catch(e => {
                console.log(e)
            })
        props.history.push(`/tournaments/${playerScorecard.tournamentId}`)
    }

    let frontNineScore = 0;
    for(let i = 0; i < 9; i++){
        frontNineScore += playerScorecard.hole_scores[i]
    }
    let backNineScore = 0;
    for(let i = 9; i < playerScorecard.hole_scores[i].length; i++){
        backNineScore += playerScorecard.hole_scores[i]
    }
    let totalScore = frontNineScore+backNineScore;
    return(
        <>
        {props.user ? (
            <>
                <Link to={`/tournaments/${playerScorecard.tournamentId}`} className="btn btn-primary col-lg-5 mx-1 mb-1">
                    Back to Tournament
                </Link>
                <h4>Scorecard for: {playerScorecard.playerName} from {playerScorecard.tournamentName}</h4>
                <table class="table table-condensed table-bordered">
                    <tr class="success text-center">
                        <th class="text-left">Hole</th>
                        <td>1</td>
                        <td>2</td>
                        <td>3</td>
                        <td>4</td>
                        <td>5</td>
                        <td>6</td>
                        <td>7</td>
                        <td>8</td>
                        <td>9</td>
                        <th class="text-uppercase"><strong>Out</strong></th>
                        <td>10</td>
                        <td>11</td>
                        <td>12</td>
                        <td>13</td>
                        <td>14</td>
                        <td>15</td>
                        <td>16</td>
                        <td>17</td>
                        <td>18</td>
                        <th class="text-uppercase"><strong>In</strong></th>
                        <th class="text-uppercase"><strong>Total</strong></th>
                        <th class="text-uppercase"><strong>HCP</strong></th>
                        <th class="text-uppercase"><strong>NET</strong></th>
                    </tr>
                    <tr class="success text-center">
                        <th class="text-left">Score</th>
                        <td>{playerScorecard.hole_scores[0]}</td>
                        <td>{playerScorecard.hole_scores[1]}</td>
                        <td>{playerScorecard.hole_scores[2]}</td>
                        <td>{playerScorecard.hole_scores[3]}</td>
                        <td>{playerScorecard.hole_scores[4]}</td>
                        <td>{playerScorecard.hole_scores[5]}</td>
                        <td>{playerScorecard.hole_scores[6]}</td>
                        <td>{playerScorecard.hole_scores[7]}</td>
                        <td>{playerScorecard.hole_scores[8]}</td>
                        <th class="text-uppercase"><strong>{frontNineScore}</strong></th>
                        <td>{playerScorecard.hole_scores[9]}</td>
                        <td>{playerScorecard.hole_scores[10]}</td>
                        <td>{playerScorecard.hole_scores[11]}</td>
                        <td>{playerScorecard.hole_scores[12]}</td>
                        <td>{playerScorecard.hole_scores[13]}</td>
                        <td>{playerScorecard.hole_scores[14]}</td>
                        <td>{playerScorecard.hole_scores[15]}</td>
                        <td>{playerScorecard.hole_scores[16]}</td>
                        <td>{playerScorecard.hole_scores[17]}</td>
                        <th class="text-uppercase"><strong>{backNineScore}</strong></th>
                        <th class="text-uppercase"><strong>{totalScore}</strong></th>
                        <th class="text-uppercase"><strong>{playerScorecard.handicap}</strong></th>
                        <th class="text-uppercase"><strong>{totalScore-playerScorecard.handicap}</strong></th>
                    </tr>
                </table>            
            </>
        ) : (<h4>Please login.</h4>)}
        </>
    )
}
export default DeletePlayerScorecard;
